import { Label, TextInput } from 'flowbite-react';
import React from 'react';

const StepFour = ({ user }) => {
    return (
        <>
            <h3 className="mb-5 text-xl font-medium text-gray-900 dark:text-white">Oupia đã gửi mã xác nhận đến <span className="text-blueTemplate font-bold">{user.email}</span></h3>

        </>
    );
};

export default StepFour;
